import css from '../static/css/index.css';

export default (props) => {
    const {
        item,
        itemNumber
    } = props;

    if (item.status) {
        return null;
    }

    return (
        <div className={css.listItem} key={itemNumber.toString()}>
            <h4>{itemNumber + 1}. </h4>
            <h3>{item.description}</h3>
            <button className={css.doneButton} onClick={() => props.deleteItem(itemNumber)}>done</button>
            <button className={css.deleteButton} onClick={() => props.deleteItem(itemNumber)}>X</button>
        </div>
    )
}
